import Home from './home';
import { Pic } from './img';


function App() {
  return (
    <div className="App">
      {/* <Home /> */}

      <Pic />
      <img src='https://cdn.pixabay.com/photo/2021/04/17/06/57/peacock-6185159_1280.jpg' height={600}width={500}></img>
      <img src='https://cdn.pixabay.com/photo/2024/05/19/05/38/ai-generated-8771533_1280.jpg' height={600}></img>


    </div>
  );
}

export default App;
